description:
Autobahn

Technology Documentary hosted by Max Raphael, published by History Channel broadcasted as part of HC Modern Marvels series in 2002 - English narration


Information
------------------------------

Imagine a super-highway designed for speed...thousands of miles of roadway unhindered by limits of any kind. Buckle up for safety as we take you for the ride of your life when we explore the fascinating history and current reality of the world's fastest freeway. The number-one works project of Third Reich, the Autobahn was known as Adolf Hitler's Road until Germany's defeat in WWII. Reconstructed and extended to more than four times its original size, it became a symbol of the New Germany.

